public class Card {
	String cardType;
	int cost, worth, actionsGranted, buysGranted, cardsGranted, victoryPoints;
	boolean special, action;

	public Card(String type)
	{
		cardType=type;
		action=false;
		
		switch(type){
			case "copper":
				makeCopper(this);
				break;
			case "silver":
				makeSilver(this);
				break;
			case "gold":
				makeGold(this);
				break;
			case "estate":
				makeEstate(this);
				break;
			case "duchy":
				makeDuchy(this);
				break;
			case "province":
				makeProvince(this);
				break;
			case "adventurer":
				makeAdventurer(this);
				action=true;
				break;
			case "ambassador":
				makeAmbassador(this);
				action=true;
				break;
			case "baron":
				makeBaron(this);
				action=true;
				break;
			case "council room":
				makeCouncilRoom(this);
				action=true;
				break;
			case "cutpurse":
				makeCutpurse(this);
				action=true;
				break;
			case "embargo":
				makeEmbargo(this);
				action=true;
				break;
			case "feast":
				makeFeast(this);
				action=true;
				break;
			case "gardens":
