public class PlayTest {

	public static void main(String[] args) {
		CardSupply supply=new CardSupply();
		Player player1=new Player(supply);
		Player player2=new Player(supply);
		int player1Victory, player2Victory;
		Turn takeTurn;
		
		while(!supply.endgame())
		{
			takeTurn=new Turn(player1, supply);
			takeTurn=new Turn(player2, supply);
			takeTurn.takeTurn(player1, player2, supply);
			takeTurn.takeTurn(player2, player1, supply);

		}

		player1Victory = player1.countPoints();
		player2Victory = player2.countPoints();
		
		if(player1Victory>=player2Victory) System.out.println("Player 1 wins with "+player1Victory+ " points");
		else System.out.println("Player 2 wins with "+player2Victory+ " points");


	}

}

import java.util.LinkedList;
import java.util.List;

public class Player {
	CardSupply discard, drawPile;
	
	public Player(CardSupply supply)
	{
		discard=new CardSupply(supply);
		drawPile=new CardSupply(supply);
		drawPile.addCard("copper", 7);
		drawPile.addCard("estate", 3);
	}


	public void shuffleDiscard(){ //doesn't actually shuffle, just moves discard back into drawPile
		drawPile.adventurer.quantity=discard.adventurer.quantity;
		discard.adventurer.quantity=0;
		drawPile.ambassador.quantity=discard.ambassador.quantity;
		discard.ambassador.quantity=0;
		drawPile.copper.quantity=discard.copper.quantity;
		discard.copper.quantity=0;
		drawPile.silver.quantity=discard.silver.quantity;
		discard.silver.quantity=0;
		drawPile.gold.quantity=discard.gold.quantity;
		discard.gold.quantity=0;
		drawPile.estate.quantity=discard.estate.quantity;
		discard.estate.quantity=0;
		drawPile.baron.quantity=discard.baron.quantity;
		discard.baron.quantity=0;
		drawPile.duchy.quantity=discard.duchy.quantity;
		discard.duchy.quantity=0;
		drawPile.province.quantity=discard.province.quantity;
		discard.province.quantity=0;
		drawPile.curse.quantity=discard.curse.quantity;
		discard.curse.quantity=0;
		drawPile.councilRoom.quantity=discard.councilRoom.quantity;
		discard.councilRoom.quantity=0;
		drawPile.cutPurse.quantity=discard.cutPurse.quantity;
		discard.cutPurse.quantity=0;
		drawPile.embargo.quantity=discard.embargo.quantity;
		discard.embargo.quantity=0;
		drawPile.feast.quantity=discard.feast.quantity;
		discard.feast.quantity=0;
		drawPile.gardens.quantity=discard.gardens.quantity;
		discard.gardens.quantity=0;
		drawPile.greatHall.quantity=discard.greatHall.quantity;
		discard.greatHall.quantity=0;
		drawPile.mine.quantity=discard.mine.quantity;
		discard.mine.quantity=0;
		drawPile.smithy.quantity=discard.smithy.quantity;
		discard.smithy.quantity=0;
		drawPile.village.quantity=discard.village.quantity;
		discard.village.quantity=0;
		drawPile.woodcutter.quantity=discard.woodcutter.quantity;
		discard.woodcutter.quantity=0;
		
	}

	public Card drawCard() {
		if(deckSize(drawPile)<1) shuffleDiscard();
		return drawPile.drawCard();
	}


	public int deckSize(CardSupply deck) {
		List<String> cardsUsed= new LinkedList<String>();
		int cardsRemaining=0;
		for(String card : deck.kingdomCards)
			cardsUsed.add(card);
		cardsUsed.add("copper");
		cardsUsed.add("silver");
		cardsUsed.add("gold");
		cardsUsed.add("duchy");
		cardsUsed.add("estate");
		cardsUsed.add("province");
		cardsUsed.add("curse");
		for(String card : cardsUsed)
			cardsRemaining+=deck.howMany(card);
		return cardsRemaining;
	}


	public int countPoints() {
		int myPoints=0;
		shuffleDiscard();
		for(String card: discard.smithy.type.allCards())
			myPoints+=(discard.cardVP(card)*(drawPile.howMany(card)));
		myPoints+=deckSize(drawPile)*drawPile.howMany("gardens");
		return myPoints;
	}
	
	
	
	

}

public class SupplyStack {
	Card type;
	int quantity, embargoTokens;
	
	public SupplyStack(String type, int count){
		this.type=new Card(type);
		quantity=count;
		embargoTokens=0;
	}
	
	public String getType(){
		return type.cardType;
	}
	
	public int hasTreasure(){
		return type.worth;
	}
		
}

import java.util.LinkedList;
import java.util.List;
import java.util.ListIterator;
import java.util.Random;

public class Turn {
	int actions, buys, treasure;
	List<Card> hand;
	
	public Turn(Player player, CardSupply theSupply){
		actions=1;
		buys=1;
		treasure=0;
		hand= new LinkedList<Card>();
		
		for(int i=0; i<5; i++){
			hand.add(player.drawCard());
		}

	}

	public void buyCards(Player player, CardSupply theSupply) {
		String whatCard="nothing";
		String pick2[]={"estate", "embargo"};
		String pick3[]={"silver", "ambassador", "great hall", "village", "woodcutter"};
		String pick4[]={"baron", "cutpurse", "feast", "gardens", "smithy"};
		String pick5[]={"council room", "mine"};
		String pick6[]={"gold", "adventurer"};
		Random randomness=new Random();
		
		switch(treasure){
		case 1: //no card costs 1, therefore default to purchasing copper 
		case 0:
			if(theSupply.copper.quantity>0){
				player.discard.addCard("copper");
				theSupply.removeCard("copper");
				whatCard="copper";
			}
			break;
		case 2:
			whatCard = pick2[randomness.nextInt(2)];
			if(theSupply.howMany(whatCard)<1) whatCard=pick2[randomness.nextInt(2)];
			player.discard.addCard(whatCard);
			theSupply.removeCard(whatCard);
			spend(2, player);
			break;
		case 3:
			whatCard= pick3[randomness.nextInt(5)];
			if(theSupply.howMany(whatCard)<1){
				for(int i=0; i<5; i++){ //make sure we're not looking forever
					whatCard= pick3[randomness.nextInt(5)];
					if(theSupply.howMany(whatCard)>0) break;
				}					
			}
			player.discard.addCard(whatCard);
			theSupply.removeCard(whatCard);
			spend(3, player);
			break;
		case 4:
			whatCard= pick4[randomness.nextInt(5)];
			if(theSupply.howMany(whatCard)<1){
				for(int i=0; i<5; i++){ //make sure we're not looking forever
					whatCard= pick4[randomness.nextInt(5)];
					if(theSupply.howMany(whatCard)>0) break;
				}					
			}
			player.discard.addCard(whatCard);
			theSupply.removeCard(whatCard);
			spend(3, player);
			break;
		case 5:
			whatCard= pick5[randomness.nextInt(2)];
			if(theSupply.howMany(whatCard)<1){
				for(int i=0; i<5; i++){ //make sure we're not looking forever
					whatCard= pick5[randomness.nextInt(2)];
					if(theSupply.howMany(whatCard)>0) break;
				}					
			}
			player.discard.addCard(whatCard);
			theSupply.removeCard(whatCard);
			spend(5, player);
			break;
		case 6:
			whatCard= pick6[randomness.nextInt(2)];
			if(theSupply.howMany(whatCard)<1){
				for(int i=0; i<5; i++){ //make sure we're not looking forever
					whatCard= pick6[randomness.nextInt(2)];
					if(theSupply.howMany(whatCard)>0) break;
				}					
			}
			player.discard.addCard(whatCard);
			theSupply.removeCard(whatCard);
			spend(6, player);
			break;
		default: 
			if(theSupply.province.quantity>0)
				{
				player.discard.addCard("province");
				theSupply.removeCard("province");
				spend(8, player);
				whatCard="province";
				}
		}
		player.discard.addCard("curse", theSupply.isEmbargod(whatCard));
		System.out.println("I purchased "+whatCard);
		return;
		
	}

	public void spend(int i, Player player) {
		ListIterator<Card> iterator = hand.listIterator();
		Card myCard;
		while(iterator.hasNext()){
			myCard=iterator.next();
			if(myCard.worth>0){
				i-=myCard.worth;
				player.discard.addCard(myCard.cardType);
				
				if(i<1) return;
			}
		}
		
	}

	public void endTurn(Player player) {
		for(int i=0; i<hand.size(); i++){
			player.discard.addCard(hand.get(i).cardType);
		}
		hand.clear();
	}
	
	public void takeTurn(Player player, Player player2, CardSupply theSupply){
		while(actions > 0){
			playAction(player, player2, theSupply);
			actions--;
		}
		

		
		while(buys > 0){
			for(int i=0; i<hand.size(); i++){
				treasure+=hand.get(i).worth; //calculate worth.
			}
			buyCards(player, theSupply);
			buys--;
		}
		
		endTurn(player);	
	}

	public void playAction(Player player, Player player2, CardSupply theSupply) {
		for(int i=0; i<hand.size()+1; i++) //go through each card in hand.
		{
			if(i==hand.size()) break;
			if(hand.get(i).action){
				System.out.println("I play "+hand.get(i).cardType);
				actions+=hand.get(i).actionsGranted;;
				buys+=hand.get(i).buysGranted;
				treasure+=hand.get(i).worth;
				for(int j=0; j<hand.get(i).cardsGranted; j++){
					hand.add(player.drawCard());
				}
				Card card=hand.get(i);
				if(hand.get(i).special) doTheThing(hand.get(i), player, player2, theSupply);
				else player.discard.addCard(hand.get(i).cardType);
				hand.remove(card);
				return;
			}
		}
		System.out.println("I forfitted an action");
		return;
	}

	public void doTheThing(Card card, Player player, Player player2, CardSupply theSupply) {
		String whatCard;
		Random randomness = new Random();
		switch(card.cardType){
		case "mine":
			ListIterator<Card> myHand = hand.listIterator();
			Card thisCard;
			
			while(myHand.hasNext()){
				thisCard=myHand.next();
				if(thisCard.cardType=="copper")
				{
					hand.remove(card);
					hand.add(new Card("silver"));
					return;
				}
				else if(thisCard.cardType=="silver")
				{
					hand.remove(card);
					hand.add(new Card("gold"));
					return;
				}
			}
			System.out.println("I chose to forfit my use of Mine");
			break;
		case "feast":
			hand.remove(card);
			String pick[]={"estate", "embargo", "silver", "ambassador", "great hall", "village", "woodcutter", "baron", "cutpurse", "feast", "gardens", "smithy", "council room", "mine"};
			whatCard= pick[randomness.nextInt(14)];
			if(theSupply.howMany(whatCard)<1){
				for(int i=0; i<14; i++){ //make sure we're not looking forever
					whatCard= pick[randomness.nextInt(2)];
					if(theSupply.howMany(whatCard)>0) break;
				}
			if(whatCard==null) System.out.println("I didn't find a card to pick up");
			else hand.add(new Card(whatCard));
			return;
			}
		case "embargo":
			hand.remove(card);
			String embargo = theSupply.kingdomCards.get(randomness.nextInt(theSupply.kingdomCards.size()));
			theSupply.embargo(embargo);
			return;
		
			}
		
		return;
		}		
	
}

import static org.junit.Assert.*;

import org.junit.Test;

public class TurnTest {

	@Test
	public void testBuyCards() {
		CardSupply supply = new CardSupply();
		Player player = new Player(supply);
		Turn testPurchase= new Turn(player, supply);
		int previous = player.deckSize(player.discard);
		testPurchase.buyCards(player, supply);
		assertTrue(previous!=player.deckSize(player.discard));
		
	}

	@Test
	public void testEndTurn() {
		CardSupply supply = new CardSupply();
		Player player = new Player(supply);
		Turn testEndTurn= new Turn(player, supply);
		testEndTurn.endTurn(player);
		assert(testEndTurn.hand.size()==0);
	}

	@Test
	public void testPlayAction() {
		CardSupply supply = new CardSupply();
		Player player = new Player(supply);
		Turn testAction= new Turn(player, supply);
		testAction.hand.add(new Card("embargo"));
		int previous = testAction.hand.size();
		testAction.playAction(player, player, supply);
		assertTrue(previous!=testAction.hand.size());
	}

}
